import React from "react";
import Contacts from "../contacts";

function App(props) {
  return (
    <div>
      <h1 className="heading">My Contacts</h1>
      <div className="card">
        <div className="top info">
          <h2>{props.name}</h2>
          <div className = "">
          <img
            src={props.src}
            alt="avatar_img"
          />
          </div>
        </div>
        <div className="bottom">
          <p>{props.phone}</p>
          <p>{props.email}</p>
        </div>
      </div>
    </div>
  );
}

export default App;
